import { Component, forwardRef, Input, OnInit } from '@angular/core';
import { ControlValueAccessor, NG_VALUE_ACCESSOR } from '@angular/forms';

@Component({
  selector: 'common-lib-custom-input',
  templateUrl: './custom-input.component.html',
  styleUrls: ['./custom-input.component.css'],
  providers: [
    {
      provide: NG_VALUE_ACCESSOR,
      useExisting: forwardRef(() => CustomInputComponent),
      multi: true,
    },
  ],
})
export class CustomInputComponent implements OnInit, ControlValueAccessor {
  @Input() title: string = '';
  @Input() isMaterial: boolean = false;

  val = '';

  get value(): any {
    return this.val;
  }
  set value(val) {
    // this value is updated by programmatic changes
    if (val !== undefined && this.val !== val) {
      this.val = val;
      this.onChange(val);
      this.onTouched(val);
    }
  }

  constructor() {}

  ngOnInit(): void {}

  onChange: any = () => {};
  onTouched: any = () => {};

  registerOnChange(fn: any): void {
    this.onChange = fn; //;(this.value);
  }

  registerOnTouched(fn: any): void {
    this.onTouched = fn;
  }

  writeValue(value: string): void {
    this.value = value;
  }

  setDisabledState?(isDisabled: boolean): void {
    console.log('setDisabledState isDisabled', isDisabled);
  }
}

import {
  AfterViewInit,
  Component,
  ElementRef,
  Input,
  OnInit,
  ViewChild,
  ViewChildren,
} from '@angular/core';

@Component({
  selector: 'common-lib-grid',
  templateUrl: './grid.component.html',
  styleUrls: ['./grid.component.css'],
})
export class GridComponent implements OnInit, AfterViewInit {
  @ViewChild('gridContainerRef') gridContainerRefEl: ElementRef;

  public columnDefs = [
    { field: 'make' },
    { field: 'model' },
    { field: 'price' },
  ];

  public rowData = [
    { make: 'Toyota', model: 'Celica', price: 35000 },
    { make: 'Ford', model: 'Mondeo', price: 32000 },
    { make: 'Porsche', model: 'Boxster', price: 72000 },
  ];

  /** List of Input Element */
  /**
   * fitToWindow default is true.
   * fitToWindow is used to set grid height as 100% of container height.
   */
  @Input() fitToWindow: boolean = true;
  /**
   * gridHeight default 500px.
   * gridHeight allowed us to set grid height in px as required.
   */
  @Input() gridHeight: string = '500px';

  constructor() {}

  ngOnInit() {}

  ngAfterViewInit() {
    this.gridContainerRefEl.nativeElement.style.height = this.fitToWindow
      ? `calc(100vh - ${
          this.gridContainerRefEl.nativeElement.getBoundingClientRect().top + 17
        }px)`
      : this.gridHeight;
  }
}

